import './App.css';
import React from "react";
import "./index.css";
import Form from "react-bootstrap/Form";
import Button from "react-bootstrap/Button";
import "bootstrap/dist/css/bootstrap.min.css";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

function App() {
  return (
    <div className="App">
      <Form>
        <Form.Group controlId="cartItemCount">
          <Form.Label>Cart Item Count</Form.Label>
          <Form.Control type="number" placeholder="Cart item count" />
        </Form.Group>
        <Button variant="primary">
          Set Cart Item Count
        </Button>
        <Form.Group controlId="checkoutUrl">
          <Form.Label>Checkout URL</Form.Label>
          <Form.Control type="text" placeholder="Checkout url" />
        </Form.Group>
        <Button variant="primary">
          Set Checkout URL
        </Button>
      </Form>
    </div>
  );
}

export default App;
